mapper.select:
select 

	from TA_JC_SUPERVISE_DELETELOG 
	where TA_JC_SUPERVISE_DELETELOG.supervise_info_id in (

		select 
		TA_JC_SUPERVISE_DELETELOG.supervise_info_id
	    from TA_JC_SUPERVISE_DELETELOG 

	        and TA_JC_SUPERVISE_DELETELOG.supervise_info_id = #{entity.superviseInfoId}
	        and TA_JC_SUPERVISE_DELETELOG.business_id = #{entity.businessId}
	        and TA_JC_SUPERVISE_DELETELOG.receive_org_name = #{entity.receiveOrgName}
	        and TA_JC_SUPERVISE_DELETELOG.supervise_type_no = #{entity.superviseTypeNo}
