	        and TA_JC_SUPERVISE_DELETELOG.supervise_time = #{entity.superviseTime}
	        and TA_JC_SUPERVISE_DELETELOG.supervise_descript = #{entity.superviseDescript}
	        and TA_JC_SUPERVISE_DELETELOG.supervise_gist = #{entity.superviseGist}
	        and TA_JC_SUPERVISE_DELETELOG.warning_content = #{entity.warningContent}
	        and TA_JC_SUPERVISE_DELETELOG.duty_tache_code = #{entity.dutyTacheCode}
	        and TA_JC_SUPERVISE_DELETELOG.rule_id = #{entity.ruleId}
	        and TA_JC_SUPERVISE_DELETELOG.feedback_endtime = #{entity.feedbackEndtime}
	        and TA_JC_SUPERVISE_DELETELOG.state = #{entity.state}
	        and TA_JC_SUPERVISE_DELETELOG.last_updatetime = #{entity.lastUpdatetime}
	        and TA_JC_SUPERVISE_DELETELOG.cc_form_instanceid = #{entity.ccFormInstanceid}
	        and TA_JC_SUPERVISE_DELETELOG.remarka = #{entity.remarka}
	        and TA_JC_SUPERVISE_DELETELOG.remarkb = #{entity.remarkb}
	        and TA_JC_SUPERVISE_DELETELOG.rule_version = #{entity.ruleVersion}
	        and TA_JC_SUPERVISE_DELETELOG.org_id = #{entity.orgId}
	        and TA_JC_SUPERVISE_DELETELOG.tscx_code = #{entity.tscxCode}
	        and TA_JC_SUPERVISE_DELETELOG.pici = #{entity.pici}
	        and TA_JC_SUPERVISE_DELETELOG.revocation_reason = #{entity.revocationReason}
	        and TA_JC_SUPERVISE_DELETELOG.start_time = #{entity.startTime}
	        and TA_JC_SUPERVISE_DELETELOG.end_time = #{entity.endTime}
	        and TA_JC_SUPERVISE_DELETELOG.status = #{entity.status}
	        and TA_JC_SUPERVISE_DELETELOG.promise_limit = #{entity.promiseLimit}
	        and TA_JC_SUPERVISE_DELETELOG.process_limit = #{entity.processLimit}
	        and TA_JC_SUPERVISE_DELETELOG.expire_date = #{entity.expireDate}
	        and TA_JC_SUPERVISE_DELETELOG.out_days = #{entity.outDays}
	        and TA_JC_SUPERVISE_DELETELOG.delete_date = #{entity.deleteDate}
	        and TA_JC_SUPERVISE_DELETELOG.check_time = #{entity.checkTime}
	        and TA_JC_SUPERVISE_DELETELOG.check_status = #{entity.checkStatus}
	        and TA_JC_SUPERVISE_DELETELOG.check_end_time = #{entity.checkEndTime}
	        and TA_JC_SUPERVISE_DELETELOG.check_status_temp = #{entity.checkStatusTemp}


)

